var zb={mario:{title:"Super Mario Bros.",text:"Super Mario Bros. est un jeu vid\u00e9o de plates-formes d\u00e9velopp\u00e9 par Nintendo sorti en 1985 sur Nintendo Entertainment System. Il s'agit du premier jeu de la s\u00e9rie Super Mario. Le joueur y contr\u00f4le Mario et voyage \u00e0 travers le Royaume Champignon afin de sauver la princesse Peach des griffes de Bowser, l'antagoniste de Mario. Le jeu est jouable \u00e0 deux joueurs, le premier contr\u00f4lant Mario et le second Luigi, le fr\u00e8re de ce dernier."},
gameboy:{title:"Game Boy",text:"La Game Boy  est une console portable de jeux vid\u00e9o 8-bits de quatri\u00e8me g\u00e9n\u00e9ration d\u00e9velopp\u00e9e et fabriqu\u00e9e par Nintendo. Elle est initialement commercialis\u00e9e au Japon le 21 avril 1989, puis en Am\u00e9rique du Nord en octobre 1989, et en Europe le 28 septembre 1990. Elle est la premi\u00e8re console portable de la gamme des Game Boy, elle est con\u00e7ue par Gunpei Yokoi et Nintendo Research & Development -- la m\u00eame \u00e9quipe ayant con\u00e7u la s\u00e9rie des Game and Watch ainsi que de nombreux jeux popularis\u00e9s sur Nintendo Entertainment System."},
amiga:{title:"Amiga",text:"L'Amiga est une famille d'ordinateurs personnels commercialis\u00e9e par Commodore International entre 1985 et 1994. Dans les ann\u00e9es 1990 il est tr\u00e8s populaire sur la sc\u00e8ne d\u00e9mo, parmi les amateurs de jeux vid\u00e9o et dans l'industrie du cin\u00e9ma et de la t\u00e9l\u00e9vision. L'Amiga offre alors un affichage plus color\u00e9 et plus fluide et un multit\u00e2che sup\u00e9rieur \u00e0 ceux des produits concurrents, avec une interface graphique similaire \u00e0 celle du Macintosh et des logiciels de traitement de texte, de musique assist\u00e9e par ordinateur et de dessin."},
n64:{title:"Nintendo 64",text:"La Nintendo 64, \u00e9galement connue sous les noms de code Project Reality et Ultra 64 lors de sa phase de d\u00e9veloppement, est une console de jeux vid\u00e9o de salon, sortie en 1996 (1997 en Europe), du constructeur japonais Nintendo en collaboration avec Silicon Graphics. Elle fut la derni\u00e8re des consoles de cinqui\u00e8me g\u00e9n\u00e9ration \u00e0 \u00eatre sortie, en concurrence avec la Saturn et la PlayStation."},minecraft:{title:"Minecraft",text:"Minecraft est un jeu vid\u00e9o de type \u00ab bac \u00e0 sable \u00bb (construction compl\u00e8tement libre - sandbox en anglais) d\u00e9velopp\u00e9 par le Su\u00e9dois Markus Persson, alias Notch, puis par le studio de d\u00e9veloppement Mojang. Ce jeu vid\u00e9o plonge le joueur dans un univers g\u00e9n\u00e9r\u00e9 al\u00e9atoirement et compos\u00e9 de voxels. Le jeu int\u00e8gre un syst\u00e8me d'artisanat ax\u00e9 sur l'exploitation de ressources naturelles (min\u00e9ralogiques, fossiles, animales et v\u00e9g\u00e9tales), puis sur leur transformation en produits artisanaux."}};new wb("canvas","overlay","oscillo");